<script>
  import { getModalStore } from '@skeletonlabs/skeleton';
  import { atcb_action } from 'add-to-calendar-button';
  import ModalButtonsComponent from '$lib/components/modals/ModalButtonsComponent.svelte';

  const modalStore = getModalStore();

  const modal = {
    type: 'confirm',
    body: "Open card?",
    buttonTextCancel: 'No',
    buttonTextConfirm: 'Yes',
    response: (r) => {
      if (r) {
        playAudio();

        const defaults = {
          spread: 360,
          ticks: 100,
          gravity: 0,
          decay: 0.94,
          startVelocity: 30,
          shapes: ["heart"],
          colors: ["FFC0CB", "FF69B4", "FF1493", "C71585"],
        };

        function shoot() {
          confetti({
            ...defaults,
            particleCount: 50,
            scalar: 2,
          });

          confetti({
            ...defaults,
            particleCount: 25,
            scalar: 3,
          });

          confetti({
            ...defaults,
            particleCount: 15,
            scalar: 4,
          });
        };

        setTimeout(shoot, 0);
        setTimeout(shoot, 100);
        setTimeout(shoot, 200);

        
      } else {
        location.reload()
      }
    },
  };

  modalStore.trigger(modal);

  const modalButtonsComponent = {
    // Pass a reference to your custom component
    ref: ModalButtonsComponent,
    // Add the component properties as key/value pairs
    props: { title: 'bg-red-500' },
    // Provide a template literal for the default component slot
    slot: '<p>Skeleton</p>'
  };

  const buttonsModal = {
    type: 'component',
    // Pass the component directly:
    component: modalButtonsComponent,
    disableAutoFocus: true,
  };
  
  const config = {
    name: "Majlis Bertandang",
    description: "Alamat Majlis: 12, Jalan Andang 1, Taman Sri Amar, 81100 Johor Bahru, Johor\nTarikh: 11 Februari 2024\nMasa: 3pm - 8pm",
    startDate: "2024-02-11",
    startTime: "15:00",
    endTime: "20:00",
    options: ["Google|Save to Google Calendar", "Apple|Save to Calendar"],
    timeZone: "currentBrowser",
  };

  function handleCalendarButtonClicked(event) {
    atcb_action(config, event.target);
  }
  
  function handleLocationButtonClicked() {
    modalStore.trigger(buttonsModal);
    document.activeElement.blur();
  }

  function playAudio() {
    var audio = document.getElementById("maher");
    audio.play();
  }

  function pauseAudio() {
    var audio = document.getElementById("maher");
    audio.pause();
  }
</script>

